package name.tachenov.leetcode;

/**
 *
 * @author alqualos
 */
public class ShortestSubstringTwoChars {
    public int lengthOfLongestSubstringTwoDistinct(String s) {
        if (s.isEmpty())
            return 0;
        int startSingle = 0, startDouble = 0;
        char charSingle = s.charAt(0);
        int charDouble = -1;
        int max = 1;
        char[] cs = s.toCharArray();
        for (int i = 1; i < cs.length; ++i) {
            char c = cs[i];
            if (c != charSingle) {
                if (c != charDouble) {
                    if (i - startDouble > max) {
                        max = i - startDouble;
                    }
                    startDouble = startSingle;
                }
                startSingle = i;
                charDouble = charSingle;
                charSingle = c;
            }
        }
        if (cs.length- startDouble > max)
            max = cs.length- startDouble;
        return max;
    }

    public static void main(String[] args) {
        ShortestSubstringTwoChars s2c = new ShortestSubstringTwoChars();
        //System.out.println(s2c.lengthOfLongestSubstringTwoDistinct("eceba"));
        //System.out.println(s2c.lengthOfLongestSubstringTwoDistinct("aaaaa"));
        System.out.println(s2c.lengthOfLongestSubstringTwoDistinct(""));
        //char[] laj = new char[50000];
        //Arrays.fill(laj, 'a');
        //System.out.println(s2c.lengthOfLongestSubstringTwoDistinct(new String(laj)));
    }
}
